	STRING_EN[5529]["ID"] = 5529
	STRING_EN[5529]["KEY"] = "novice_002"
	STRING_EN[5529]["VALUE"] = {}
		STRING_EN[5529]["VALUE"][1] = "You are the earliest civilization in universe"
		STRING_EN[5529]["VALUE"][2] = " but you sabotaged the universe arbitrarily because of selfishness"
		STRING_EN[5529]["VALUE"][3] = " greed"
