	STRING_EN[5530]["ID"] = 5530
	STRING_EN[5530]["KEY"] = "novice_003"
	STRING_EN[5530]["VALUE"] = {}
		STRING_EN[5530]["VALUE"][1] = "Every age has some inevitable problems during development"
		STRING_EN[5530]["VALUE"][2] = " and we have been trying to fix them."
	STRING_EN[5530]["real_idx"] = 5530

STRING_EN["index"][5531] = 5531
STRING_EN[5531] = {}
	STRING_EN[5531]["ID"] = 5531
	STRING_EN[5531]["KEY"] = "novice_004"
	STRING_EN[5531]["VALUE"] = "Problems? Let's fix them for you."
	STRING_EN[5531]["real_idx"] = 5531

STRING_EN["index"][5532] = 5532
STRING_EN[5532] = {}
	STRING_EN[5532]["ID"] = 5532
	STRING_EN[5532]["KEY"] = "novice_005"
	STRING_EN[5532]["VALUE"] = {}
		STRING_EN[5532]["VALUE"][1] = "But you have only diodes and best solution"
		STRING_EN[5532]["VALUE"][2] = " do you understand art"
		STRING_EN[5532]["VALUE"][3] = " life and beauty? Do you know happiness"
		STRING_EN[5532]["VALUE"][4] = " responsibilities and undertaking? Do you understand family"
		STRING_EN[5532]["VALUE"][5] = " friendship and love?"
	STRING_EN[5532]["real_idx"] = 5532

STRING_EN["index"][5533] = 5533
STRING_EN[5533] = {}
	STRING_EN[5533]["ID"] = 5533
	STRING_EN[5533]["KEY"] = "novice_006"
	STRING_EN[5533]["VALUE"] = "We don't need these. They will make us greedy and selfish just like you."
	STRING_EN[5533]["real_idx"] = 5533

STRING_EN["index"][5534] = 5534
STRING_EN[5534] = {}
	STRING_EN[5534]["ID"] = 5534
	STRING_EN[5534]["KEY"] = "novice_007"
	STRING_EN[5534]["VALUE"] = {}
		STRING_EN[5534]["VALUE"][1] = "We will improve and change the future of universe. It will become better"
		STRING_EN[5534]["VALUE"][2] = " equal and more orderly"
		STRING_EN[5534]["VALUE"][3] = " and finally extremely powerful."
	STRING_EN[5534]["real_idx"] = 5534

STRING_EN["index"][5535] = 5535
STRING_EN[5535] = {}
	STRING_EN[5535]["ID"] = 5535
	STRING_EN[5535]["KEY"] = "novice_008"
	STRING_EN[5535]["VALUE"] = "What the point if your created world is working lifelessly like a machine?"
	STRING_EN[5535]["real_idx"] = 5535

STRING_EN["index"][5536] = 5536
STRING_EN[5536] = {}
	STRING_EN[5536]["ID"] = 5536
	STRING_EN[5536]["KEY"] = "novice_009"
	STRING_EN[5536]["VALUE"] = {}
		STRING_EN[5536]["VALUE"][1] = "This is command center"
		STRING_EN[5536]["VALUE"][2] = " I'm chief commander captain Caeser"
		STRING_EN[5536]["VALUE"][3] = " now I announce: unlock all weapon systems"
		STRING_EN[5536]["VALUE"][4] = " make maximum use of output power; shut down other systems"
		STRING_EN[5536]["VALUE"][5] = " attack enemies' weapon system first with a full strike."
	STRING_EN[5536]["real_idx"] = 5536

STRING_EN["index"][5537] = 5537
STRING_EN[5537] = {}
	STRING_EN[5537]["ID"] = 5537
	STRING_EN[5537]["KEY"] = "novice_010"
	STRING_EN[5537]["VALUE"] = {}
		STRING_EN[5537]["VALUE"][1] = "It's my honor to fight with you"
		STRING_EN[5537]["VALUE"][2] = " for human's last system"
		STRING_EN[5537]["VALUE"][3] = " for our families and children"
		STRING_EN[5537]["VALUE"][4] = " we will hold on our positions to the last moment to protect them. I command"
		STRING_EN[5537]["VALUE"][5] = " fire with all power"
		STRING_EN[5537]["VALUE"][6] = " do not stop."
	STRING_EN[5537]["real_idx"] = 5537

