	STRING_EN[6037]["ID"] = 6037
	STRING_EN[6037]["KEY"] = "Arena_introduce"
	STRING_EN[6037]["VALUE"] = {}
		STRING_EN[6037]["VALUE"][1] = "Rules\n1.Your ranking is decided by points. Final ranking will be settled every 3 days"
		STRING_EN[6037]["VALUE"][2] = " corresponding rewards will be sent automatically by system at the same time. Points will be cleared and a new round will start after that;\n2.There are 10 free chances to challenge every day (a challenge costs one chance no matter win or lose)"
