	STRING_EN[6038]["ID"] = 6038
	STRING_EN[6038]["KEY"] = "Trial_introduce"
	STRING_EN[6038]["VALUE"] = {}
		STRING_EN[6038]["VALUE"][1] = "Rules\n1.Each day you can challenge one time in Trial for free. Challenge chances are shared by all Trial dungeons. There are entry requirements for each dungeon;\n2.Trial progress is saved forever"
		STRING_EN[6038]["VALUE"][2] = " the full-star stage cannot be challenged again;\n3.You can choose airships before entering Trial"
		STRING_EN[6038]["VALUE"][3] = " but they cannot be changed after entering Trial. HP of airships will be saved after a battle"
		STRING_EN[6038]["VALUE"][4] = "  destroyed airships cannot be used in next stage;\n4.You can enhance airships in city during Trial"
		STRING_EN[6038]["VALUE"][5] = " the airships will have new attributes in Trial;\n5.You can finish this Trial immediately using reset;\n6.You will be rewarded for only first victory"
		STRING_EN[6038]["VALUE"][6] = " but you can get star treasure for accumulated stars;"
