		STRING_EN[6039]["VALUE"][1] = "Star Occupation Rules\n1. Resources Collection. There are three types of resource field. The higher level it is"
		STRING_EN[6039]["VALUE"][2] = " the larger capaticy it has. Collection speed depends on character level and Command Center level. Fleet will return when collection completed with a report mail. Collecting fleet is counted as a battle squad and should be dispatched with airships. If resources field is occupied by NPC enemies"
		STRING_EN[6039]["VALUE"][3] = " they should be defeated first before collecting resources"
		STRING_EN[6039]["VALUE"][4] = " but no stamina will be cost;\n2.Resources Raid. When a resource field is occupied by another player"
		STRING_EN[6039]["VALUE"][5] = " it can be raid. The collected resources will be robbed and raider will occupy this field and continue collecting. Collecting fleet is counted as a battle squad and should be dispatched with airships. Raid costs some stamina.\n3.Wreckage Salvage. It cost time to salvage the wreckage. The higher level salvage is"
		STRING_EN[6039]["VALUE"][6] = " the more rewards could be gained. Extra alliance gifts will be rewarded for an alliance member. Salvage fleet is counted as a battle squad but doesn't need airships. Salvage costs stamina;\n4. Destroy Planet. Various items can be gained here. There is a certain chance to encounter enemy. Battling fleet is counted as a battle squad and should be dispatched with airships. Destroying planet costs some stamina;\n5.Assault. Other players in nearby area can be assaulted; winners can get a large amount of rewards. battling fleet is counted as a battle squad and should be dispatched with airships. Assault costs a large amount of stamina;"
	STRING_EN[6039]["real_idx"] = 6039

